import React from 'react';
import Question from './Question';

const questionsList = [
  {
    questionId: 1,
    questionText: 'A',
    answersOptions: [ '1','2','3','4']
  },
  {
    questionId: 2,
    questionText: 'B',
    answersOptions: [ '1','2','3','4']
  },
  {
    questionId: 3,
    questionText: 'C',
    answersOptions: [ '1','2','3','4']
  },
  {
    questionId: 4,
    questionText: 'D',
    answersOptions: [ '1','2','3','4']
  },
];

function App() {
  return (
    <div className="App">

          <Question questionDetail = {questionsList[0]}></Question>
    </div>
  );
}

export default App;
